import React from 'react';

type InfoboxProps = {
    Title: string;
    Description: string;
    Image?: string;
};

const Infobox: React.FC<InfoboxProps> = ({ Title, Description, ImageName }) => {
    return (
        <div>
            <div>
                <h1>{Title}</h1>
                <p>{Description}</p>
            </div>
            <Image src={ImageName} alt="Infobox Image" />
        </div>
    );
};

export default Infobox;
